INSERT INTO `product` VALUES (1,1,'세트','화이트 갈릭버거 세트',7100,'resources/img/product/1.jpg','<br>세트 메뉴에는 <b>버거 + 케이준양념감자 + 펩시 콜라 (355ml)</b> 로 구성됩니다.<br>1000원 추가 시 양념감자 → 치즈감자로 변경 (추가사항에서 변경 가능)<br><br>\n크림처럼 부드러운 화이트 갈릭 소스에 <br>프리미엄 더블햄과 통가슴살 패티까지<br> 하나에 다 담은 묵직한 버거! ',1,1,0,1,'54,7,85',1,36,NULL,1000,500,0),(2,1,'세트','싸이버거 세트',6600,'resources/img/product/2.jpg','<br>세트 메뉴에는 <b>버거 + 케이준양념감자 + 펩시 콜라 (355ml)</b> 로 구성됩니다.<br>1000원 추가 시 양념감자 → 치즈감자로 변경 (추가사항에서 변경 가능)<br><br>\n매콤한 통다리살 패티가 통째로~~<br>\n매콤한 양파와 신선한 양상추가 절묘하게 조화를 이뤄  <br>\n깔끔한 맛을 느낄수 있는 프리미엄 수제버거',1,1,0,1,'54,7,85',1,3,NULL,1000,500,0),(3,1,'세트','불싸이버거 세트',6800,'resources/img/product/3.jpg','<br>세트 메뉴에는 <b>버거 + 케이준양념감자 + 펩시 콜라 (355ml)</b> 로 구성됩니다.<br>1000원 추가 시 양념감자 → 치즈감자로 변경 (추가사항에서 변경 가능)<br><br>\n불 맛이 살아있는<br>\n싸이버거의 진火<br>\n<br>\n맘스터치의 베스트 메뉴인 싸이버거를<br>\n매운 버전으로 즐길 수 있는 메뉴<br>',1,1,0,1,'54,7,85',1,4,NULL,1000,500,0),(4,1,'세트','마살라버거 세트',7000,'resources/img/product/4.jpg','<br>세트 메뉴에는 <b>버거 + 케이준양념감자 + 펩시 콜라 (355ml)</b> 로 구성됩니다.<br>1000원 추가 시 양념감자 → 치즈감자로 변경 (추가사항에서 변경 가능)<br><br>\n다양한 양념과 버터가 들어간 마살라 소스로 <br>\n고소하고 깊은 인도의 풍미를 느낄 수 있는 버거<br>',1,1,0,1,'54,7,85',1,5,NULL,1000,500,0),(5,1,'세트','치즈베이컨버거 세트',7500,'resources/img/product/5.jpg','<br>세트 메뉴에는 <b>버거 + 케이준양념감자 + 펩시 콜라 (355ml)</b> 로 구성됩니다.<br>1000원 추가 시 양념감자 → 치즈감자로 변경 (추가사항에서 변경 가능)<br><br>\n두툼한 통가슴살패티와 바삭하고 스모키한 베이컨칩,<br>\n부드러운 화이트치즈소스가 어우러진 환상적인 조합의 프리미엄 버거',1,1,0,1,'54,7,85',1,6,NULL,1000,500,0),(6,1,'세트','딥치즈버거 세트',7000,'resources/img/product/6.jpg','<br>세트 메뉴에는 <b>버거 + 케이준양념감자 + 펩시 콜라 (355ml)</b> 로 구성됩니다.<br>1000원 추가 시 양념감자 → 치즈감자로 변경 (추가사항에서 변경 가능)<br><br>\n부드러운 치즈와 한층 더 촉촉해진 닭가슴살로<br>\n딥~하게 빠져드는 버거',1,1,0,1,'54,7,85',1,7,NULL,1000,500,0),(11,4,'프레쉬','서브웨이클럽',6600,'resources/img/product/11.jpg','명실공히 시그니처 써브! <br>\n터키, 비프, 포크 햄의 완벽한 앙상블<br><br>\n<b>추천 소스</b><br>\n<u>랜치드레싱</u> / <u>레드와인식초</u>',1,1,0,1,'1,2,3,4,5,6,64,66,67,68,70',1,6,NULL,NULL,NULL,0),(17,4,'프리미엄','스테이크&치즈',7300,'resources/img/product/17.jpg','육즙이 쫙~풍부한 비프 스테이크의 풍미가 입안 한가득<br><br>\n<b>추천 소스</b><br>\n<u>머스타드</u> / <u>마요네즈</u>',1,1,0,1,'1,2,3,4,5,6,64,66,67,68,70',1,12,NULL,NULL,NULL,0),(20,4,'클래식','비엘티',6100,'resources/img/product/20.jpg','오리지널 아메리칸 베이컨의 풍미와 바삭함 그대로~<br><br>\n<b>추천 소스</b><br>\n<u>레드와인식초</u> / <u>올리브오일</u> / <u>스위트어니언</u>\n',1,1,0,1,'1,2,3,4,5,6,64,66,67,68,70',1,0,NULL,NULL,NULL,0),(21,4,'클래식','이탈리안 비엠티',6100,'resources/img/product/21.jpg','7시간 숙성된 페퍼로니, 살라미 그리고 <br>\n햄이 만들어내는 최상의 조화!<br>\n전세계가 사랑하는 No.1 베스트셀러!<br>\n Biggest Meatiest Tastiest, It\'s B.M.T.!<br><br>\n<b>추천 소스</b><br>\n<u>마요네즈</u> / <u>머스타드</u> / <u>디종홀스래디쉬</u>',1,1,0,1,'1,2,3,4,5,6,64,66,67,68,70',1,1,NULL,NULL,NULL,0),(22,4,'프리미엄','치킨 데리야끼',6600,'resources/img/product/22.jpg','담백한 치킨 스트립에 달콤짭쪼름한 써브웨이 특제 <br>\n데리야끼 소스와의 환상적인 만남<br><br>\n<b>추천 소스</b><br>\n<u>마요네즈</u> / <u>바비큐</u> / <u>랜치드레싱</u>',1,1,0,1,'1,2,3,4,5,6,64,66,67,68,70',1,13,NULL,NULL,NULL,0),(23,4,'프리미엄','치킨베이컨 랜치',6900,'resources/img/product/23.jpg','바삭한 베이컨과 담백한 치킨의 이중주<br><br>\n<b>추천 소스</b><br>\n<u>랜치드레싱</u>',1,1,0,1,'1,2,3,4,5,6,64,66,67,68,70',1,14,NULL,NULL,NULL,0),(24,4,'프리미엄','써브웨이 멜트',6900,'resources/img/product/24.jpg','자신있게 추천하는 터키, 햄, 베이컨의 완벽한 맛의 밸런스<br><br>\n<b>추천 소스</b><br>\n<u>허니 머스터드</u> / <u>스위트칠리</u>',1,1,0,1,'1,2,3,4,5,6,64,66,67,68,70',1,15,NULL,NULL,NULL,0),(25,4,'프리미엄','풀드포크',6900,'resources/img/product/25.jpg','7시간 저온 훈연한 미국 정통 스타일의 리얼 <br>\n바비큐 풀드포크는 오직 써브웨이에서<br><br>\n<b>추천 소스</b><br>\n<u>스모키 바비큐 소스</u>',1,1,0,1,'1,2,3,4,5,6,64,66,67,68,70',1,16,NULL,NULL,NULL,0),(26,4,'샐러드','베지 샐러드',6400,'resources/img/product/26.jpg','<b>60 Kcal</b><br>\n7가지 야채만으로도 깔끔한 조화! <br>\n기본에 충실한 베지 찹 샐러드<br><br>\n<b>추천 소스</b><br>\n<u>올리브오일</u> / <u>레드와인식초</u> / <u>이탈리안 드레싱</u>',1,1,0,1,'1,2,3,4,5,6,64,66,67,68,70',1,40,NULL,NULL,NULL,0),(27,4,'샐러드','로티세리 치킨 샐러드',8400,'resources/img/product/27.jpg','<b>170 Kcal</b><br>\n촉촉한 바비큐 치킨의 풍미가득. <br>\n손으로 찢어 더욱 부드러운 치킨이 찹 샐러드에 쏙<br><br>\n<b>추천 소스</b><br>\n<u>리치 시저</u>',1,1,0,1,'1,2,3,4,5,6,64,66,67,68,70',1,41,NULL,NULL,NULL,0),(28,26,'메인','엽기떡볶이',15000,