t/50.jpg','[베스트&스테디셀러 SINCE 2003] <br>\n2003년에 한국 최초로 개발 출시한 한솥 대표 인기 메뉴입니다. <br>\n밥 위에 지단채와 슬라이스한 치킨가라아게를 올렸습니다. <br>\n따로 드리는 조미 김을 잘게 부수어 넣고 <br>\n 마요드레싱과 덮밥소스를 뿌린 후 비벼 먹는 맛이 일품입니다.<br>',1,1,0,1,'71,156,157,202',1,0,NULL,1000,150,0),(51,5,'보울도시락','빅치킨마요',4500,'resources/img/product/51.jpg','배부르게 먹고 싶은 날 즐겨보세요. <br>\n치킨마요에 밥(+70g), 치킨(+15g), 소스(+10g) <br>\n모두 빅으로 푸짐하게 담았습니다.<br>',1,1,0,1,'71,156,157,202',1,1,NULL,1000,150,0),(52,5,'보울도시락','왕치킨마요',5200,'resources/img/product/52.jpg','마요시리즈 중 가장 양이 많은 빅치킨마요보다<br> \n더 푸짐한 양을 원하는 고객을 위해<br> \n밥 370g에 치킨양도 늘리고, 커플소스도 2개씩 제공됩니다.<br>\n',1,1,0,1,'71,156,157,202',1,2,NULL,1000,150,0),(53,5,'보울도시락','한솥 철판볶음밥',4700,'resources/img/product/53.jpg','고기집에서 먹는 볶음밥 형태로<br>\\n짭조름한 베이컨, 아삭한 양파, 대파, 홍 피망을 넣어 불 맛을 잘 살렸습니다. <br>\\n영양 가득한 계란프라이와 김 가루와 함께 풍미 가득한 철판볶음밥을 즐겨보세요.<br>',1,1,0,1,'156,157,202',1,3,NULL,1000,150,0),(54,5,'보울도시락','돈까스 카레',4900,'resources/img/product/58.jpg','[베스트&스테디셀러 SINCE 1993]<br>\n두툼한 국내산 등심 돈까스와 누구도 흉내낼 수 없는 <br>\n한결같은 맛을 고수해 온 한솥 카레를 함께 즐겨보세요.<br>',1,1,0,1,'71,156,157,202',1,4,NULL,1000,150,0),(55,5,'사각도시락','치킨제육 도시락',5400,'resources/img/product/55.jpg','치킨가라아게와 부드러운 제육볶음으로 구성한 도시락입니다.<br> \n짭조름한 치킨과 매콤한 제육볶음으로 든든한 한 끼가 됩니다.<br>',1,1,0,1,'71,156,157,202',1,5,NULL,1000,150,0),(56,5,'사각도시락','동백 도시락',6000,'resources/img/product/56.jpg','[베스트&스테디셀러 SINCE 2008]<br>\n연하고 부드러운 햄버그에 쫄깃한 떡을 넣은 떡햄버그와 <br>\n탱글탱글한 식감이 살아있는 새우튀김, 호주산 소불고기, <br>\n한솥만의 명품 치킨, 해물 볼어묵, 각종 밑반찬은 물론 김, <br>\n타르타르소스가 들어간 도시락입니다.',1,1,0,1,'71,156,157,202',1,6,NULL,1000,150,0),(57,5,'사각도시락','돈치 고기고기 도시락',6200,'resources/img/product/57.jpg','돈까스, 치킨가라아게, 소불고기, 제육볶음으로 구성한 돈.치.고기.고기 도시락입니다.<br>\n고기반찬과 튀김을 함께 즐기고 싶은 분에게 추천합니다.<br>\n한솥의 돈까스는 국내산 돼지고기의 등심 부위를 도톰하게 썰어 튀겨 육즙이 풍부합니다.<br>',1,1,0,1,'71,156,157,202',1,7,NULL,1000,150,0),(58,5,'사각도시락','돈까스 도련님 도시락',4900,'resources/img/product/54.jpg','[베스트&스테디셀러 SINCE 1994] <br>\n도련님 도시락의 오징어까스 대신 <br>\n두툼한 돼지고기 등심으로 만든 돈까스를 넣어 구성했습니다. <br>\n한솥의 대표 메뉴입니다.<br>',1,1,0,1,'71,156,157,202',1,8,NULL,1000,150,0),(59,