--
-- Table structure for table `restaurant`
--

DROP TABLE IF EXISTS `restaurant`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `restaurant` (
  `idx` int(11) NOT NULL AUTO_INCREMENT,
  `idx_target` int(11) DEFAULT NULL,
  `name` varchar(45) DEFAULT NULL,
  `location` varchar(200) DEFAULT NULL,
  `tel` varchar(45) DEFAULT NULL,
  `description` text,
  `imgpath` varchar(45) DEFAULT NULL,
  `cnt_star` int(11) DEFAULT NULL,
  `cnt_comment` int(11) DEFAULT NULL,
  `start` varchar(45) DEFAULT NULL,
  `end` varchar(45) DEFAULT NULL,
  `isActive` tinyint(4) DEFAULT '1',
  `isPause` tinyint(4) DEFAULT NULL,
  `pause_description` varchar(45) DEFAULT NULL,
  `sequence` int(11) DEFAULT NULL,
  `country_origin` mediumtext,
  `sub_description` varchar(45) DEFAULT NULL,
  `isOrderPause` tinyint(4) DEFAULT '0',
  `unit_amount` int(11) DEFAULT '1',
  `unit_time` int(11) DEFAULT '1',
  `cnt_sell` int(11) DEFAULT '0',
  PRIMARY KEY (`idx`),
  KEY `fk_restaurant_idx` (`idx_target`),
  CONSTRAINT `fk_restaurant` FOREIGN KEY (`idx_target`) REFERENCES `target` (`idx`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=29 DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

--
-- Dumping data for table `restaurant`
--

LOCK TABLES `restaurant` WRITE;
/*!40000 ALTER TABLE `restaurant` DISABLE KEYS */;
INSERT INTO `restaurant` VALUES (1,1,'맘스터치','행신동 1079-2','031-971-8399','<br>\n미리 만들어 놓고 나눠주다시피 하는 판매가 아닌<br>\n\'정성어린 한 끼 식사를 준비한다\'는 마음가짐으로 주문을 받는 즉시<br>\n제조를 시작하여 따듯하고 신선한 높은 퀄리티의 제품을 고객에게 제공하는<br>\n\'고객을 가장 먼저 생각하는 맘스터치\'입니다. <br><br>\n<b>#존맛탱 #신선 #맛집 #혜자</b>','resources/img/restaurant/1.png',5,232,'10:30','18:30',1,0,'포만감 임시휴업',3,'-마살라치킨,마살라윙,마살라텐더,찜햇닭,찜햇닭윙,찜햇닭강정,<br>\n라이스앤치킨너겟,치파오치킨,불사치킨,불사텐더,불사윙,순살뿌치,<br>\n뿌치,후레이크치킨,순살치킨,후라이드치킨,통치킨,핫후라이드치킨,<br>\n핫통치킨,양념치킨,조청치킨,조청강정,치킨강정,순상강정,케이준강정,<br>\n강정콤보,케이준윙,후-라이드 닭다리,할라피뇨너겟,치즈할라피뇨너겟,<br>\n팝콘볼,텐더로인,치킨샐러드,휠랩 (닭고기 : 국내산)<br>\n-찜햇닭,라이스앤치킨너겟 (쌀 : 국내산)<br>\n-치파오(닭고기 : 브라질산)<br>\n-마살라버거,치즈베이컨버거,치킨커틀렛버거,딥치즈버거,리샐버거,<br>\n휠렛버거,할라피뇨통가슴살버거,불갈비치킨버거,화이트갈릭버거,<br>\n햄치즈휠렛버거,프라이랩 (패티 : 닭고기 국내산)<br>\n-스파이시디럭스불고기버거,디럭스불고기버거,스파이시불고기버거,<br>\n불고기버거 (패티 : 우육 호주산, 돈육 국내산, 닭고기 국내산)<br>\n-인크레더블버거,화이트갈릭버거,햄지츠휠랫버거,프라이랩<br>\n (햄 : 돈육 외국산, 국내산 섞음, 돈지방 국내산)\n-인크레더블버거,싸이버거,불싸이버거,할라피뇨통살버거 <br>\n(패티 : 닭고기 브라질산, 태국산 섞음)\n-치즈베이컨버거,베이컨에그랩 (베이컨 : 돈육 외국산)\n-통새우버거 (패티 : 새우 인도네시아산)',NULL,0,1,1,2),(2,1,'양계장집 아들','행신동 707','031-970-5317','<br>\n양계장집 아들에서는 기존 시장에 넘쳐나는 다양한<br>\n치킨 메뉴와는 달리 재료 본연의 깊은 맛을 살릴 수 있는<br>\n기본에 집중한 메뉴들로 구성하였습니다.<br><br>\n<b>#겉빠삭 #속촉촉 #이런날 #치킨안먹으면 #죄입니다 #죄</b>','resources/img/restaurant/2.png',0,0,'15:30','18:30',0,0,'포만감 임시휴업',NULL,NULL,NULL,0,1,1,0),(3,1,'엽기떡볶이','행신동 761-3 탑프라자','031-979-8593','<br>\n한번 먹고 두 번 먹어도 질리지 않는<br>\n엽기떡볶이만의 매력을 느껴보세요~<br>\n눈물나게 맵지만 결코 잊을수 없는 맛의 엽기떡볶이.<br>\n상상 그 이상으로 맵지만 자꾸만 먹고 싶어지는<br>\n중독성 강한 일품떡볶이!<br><br>\n<b>요청사항에 원하시는 매운맛 정도를 적어주세요.<br>\n▷ <u>매운맛</u> / <u>오리지널(기본선택)</u> / <u>덜 매운맛</u> / <u>착한맛</u> ◁\n</b><br><br>\n<b>#밀린과제와 #시험공부엔 #엽떡 #나라가허락한 #유일한 #마약</b>','resources/img/restaurant/3.png',5,16,'10:30','18:30',0,0,'포만감 임시휴업',NULL,NULL,NULL,0,1,1,0),(4,1,'서브웨이','행신동 707-1','031-994-8929','<br>\n전세계 넘버원 브랜드 Subway!<br>\n50년 전통의 세계 최고의 샌드위치를 맛보세요!<br><br>\n<b>요청사항에 원하시는 <u>빵 / 치즈 / 야채 / 소스</u>를 적어주세요.<br>\n미 기입 시 추천 레시피로 배달해 드립니다!<br><br>\n▷ 모든 샌드위치 메뉴는 15cm 기준입니다. ◁\n </b>\n<br><br>\n<b>#악마의 #레시피 #신선함 #당일직접 #굽는 #쿠키</b>','resources/img/restaurant/4.png',5,53,'9:30','18:30',0,0,'포만감 임시휴업',NULL,NULL,NULL,0,1,1,0),(5,1,'한솥 도시락','행신동 1083-3','031-938-9994','<br>\n한솥은 \'따끈한 도시락으로 지역사회에 공헌한다\' 라는<br>\n기업이념 아래, 고객 이익을 최우선으로 하며 엄선된<br>\n좋은 식재료만 사용하는 대한민국 외식종합기업 시장을<br>\n리드하는 글로벌 종합외식기업 입니다.<br><br>\n\n<b> #따끈한 #집밥 #혼밥 #먹방 #한식 #포장 #간편식 </b>\n','resources/img/restaurant/5.png',0,0,'9:30','18:30',1,0,'임시휴업',8,'백미, 현미 : 국내산<br>\n배추, 고춧가루, 김치찌개(배추)  : 국내산<br>\n떡산적, 탕수육, 돈까스, 김치찌개 : 국내산 / 제육볶음 : 미국산<br>\n떡산적, 닭가슴살, 미트볼 : 국내산 / 불닭덮밥 : 미국산<br>\n치킨가라아게, 닭강정 : 브라질산<br>\n소불고기, 육개장 : 호주산<br>\n고등어, 연어 : 노르웨이산<br>\n',NULL,0,2,1,0),(6,1,'피자 스쿨','행신동1080-5 미라클프라자105호','031-979-5589','<br>\n<b>사업규모가 커져도 결코 잊지 않는 것,<br>\n품질만큼은 최고급으로 유지하겠다는 약속과 다짐</b><br>\n피자스쿨은 언제 어디서나 부담없는 가격으로 즐길 수 있는<br>\n최고의 품질과 맛을 유지하게 위해 노력할것이며<br>\n늘 고객여러분 곁에 있는 친구같은 브랜드가 되도록 하겠습니다.<br><br>\n\n<b> #담백도우 #특제소스 #혼피자 # #1인1피자 #포장 #간편식 </b>','resources/img/restaurant/6.png',0,0,'9:30','18:30',1,0,'포만감 임시휴업',7,'소고기 : 호주산<br>\n돼지고기 : 국새산, 수입산 혼합<br>\n닭고기 : 국내산, 수입산 혼합<br>',NULL,0,1,1,0),(7,1,'가마로 강정','행신동 1080-1','031-978-7292','<br><b>가마로강정은 맛과 정직을 바탕으로 합니다.</b><br>\n늘 한결 같은 맛, 행복한 즐거움으로 가득한<br>\n닭강정 브랜드 찾으시는 고객분들도 함께<br>\n행복함이 가득할 수 있는 브랜드로 오래도록 사랑 받고자 합니다.<br><br>\n\n<b> #떡강정 #닭강정 #치밥 # #1인1강정 #겉바속촉 #간편식 </b>','resources/img/restaurant/7.png',0,0,'15:30','18:30',1,0,'포만감 임시휴업',5,'달콤강정, 매콤강정, 땡초불강정 : 브라질산<br>\n후라이드 : 국내산<br>',NULL,0,1,1,0),(8,1,'서가원김밥','행신동 1075','031-971-9200','<br>\n<b>“서가원(瑞家元)\'</b>은 상서로운 집에서 만드는 최고의 음식이라는 뜻으로<br>\n전통의 현대적 해석을 통해 만들어진 대한민국 최고의 프리미엄 한식 브랜드입니다” <br><br>\n\n<b>  #고급한식 #집밥 #유부초밥 #일품식 #간편식 </b>','resources/img/restaurant/8.png',0,0,'9:30','18:30',0,0,'포만감 임시휴업',4,'쌀 : 국내산<br>\n김치 : 국내산<br>\n햄 : 국내산<br>\n돼지고기 : 국내산<br>\n소고기 : 호주산<br>',NULL,0,1,1,0),(9,1,'강순자 김치찌개','행신동 1075','031-971-3420','<br>대한민국 대표 NO.1 김치찌개 전문점','resources/img/restaurant/9.png',0,0,'9:30','18:30',1,0,'포만감 임시휴업',9,'쌀 : 국내산<br>\n돼지고기 : 국내산<br>\n김치 배추 : 국내산 / 고추가루 : 중국산<br>\n두부(콩) : 수입산<br>',NULL,0,1,1,0),(10,1,'미소야','행신동 1080-5 미라클프라자','031-972-4003','<br>수제돈카츠, 우동, 모밀 등 맛과 웃음이 있는 공간.\n<br><br>\n<b>단무지, 깍두기 더 필요하시면 요청사항에 적어주세요.<br>\n(단, 포함되는 메뉴에만 적용됩니다.) \n</b>\n<br>','resources/img/restaurant/10.png',0,0,'10:30','18:30',1,0,'포만감 임시휴업',2,'돼지고기 : 국내산, 독일산, 미국산<br>\n닭고기 : 브라질산<br>\n소고기 : 미국산<br>\n쌀 : 국내산<br>\n배추 : 국내산<br>',NULL,0,1,1,0),(11,1,'굽네 치킨','행신동 195-1','0504-3143-8334','<br><b>튀기지 않고 오븐에 구워</b> 치킨 본연의 맛을 유지하며<br>\n기름은 쏙 빼고 그 자리에 맛과 건강을 채워 넣는 치킨의 혁신<br><br>\n<b><굽네치킨 행신2호점></b><br>\n메뉴얼 준수! 신속한 배달! 더 나은 서비스로 고객님께 보답하겠습니다.<br>\n<br>\n<b style=\"color:red\">[항공대 특가]<br>\n 피자(L) + 콜라(1.25L) 할인 중 !</b>','resources/img/restaurant/11.png',0,0,'11:30','18:30',1,0,'포만감 임시휴업',1,'닭고기 : 국내산<br>\n돼지고기 : 외국산(스페인, 프랑스, 헝가리)',NULL,0,1,1,0),(12,1,'신전 떡볶이','-','031-973-1070','<br>매운 떡볶이를 좋아하는<br>VIP 공간_신전떡볶이 \n<br><br>\n<b>요청사항에 원하시는 매운맛 정도를 적어주세요.<br>\n▷ <u>매운맛</u> / <u>중간맛(기본선택)</u> / <u>순한맛</u> ◁\n<br><br><br>\n※ 13시 부터 배달이 가능합니다.\n</b>\n<br>','resources/img/restaurant/12.png',0,0,'11:30','18:30',1,0,'포만감 임시휴업',6,'쌀 : 국내산<br>\n어묵 : 국내산<br>\n김치 : 중국산<br>',NULL,0,1,1,0),(13,1,'빽다방','-','031-979-2100','<br>\n싸다! 크다! 맛있다!<br>\n<br>\n합리적인 가격, 놀라운 퀄리티의 <br>\n커피전문점 <b>“빽다방”</b>입니다.\n','resources/img/restaurant/13.png',0,0,'12:30','18:30',0,0,'포만감 임시휴업',0,'소세지빵 소세지<br>\n- 돼지고기 : 수입산, 국내산 섞음<br>\n- 소고기 : 호주산',NULL,0,1,1,0),(14,2,'봉구스 밥버거','전북 군산시 미룡동 866-1','063-464-4680','<br>봉구스밥버거는 어머니의 정성과 <br>\n신세대의 입맛에 어우러진 \'신개념 주먹밥\'입니다.<br>\n\'영양\'과 \'맛\'뿐만 아니라 <br>\n\'저렴한 가격\'과 \'든든함\'으로 <br>\n맛있는 한 끼를 제공하고자 합니다.','resources/img/restaurant/14.png',0,0,'10:30','18:30',1,0,'포만감 임시휴업',2,'쌀: 국산<br>\n배추: 중국산<br>\n고춧가루: 중국산<br>\n소고기: 호주산<br>\n돼지고기: 국산<br>\n닭다리살: 브라질산<br>\n오징어: 중국산<br>\n햄: 덴마크<br>\n소시지: 국산<br>',NULL,0,1,1,0),(15,2,'이삭토스트','미룡동 416-1 스위티pc방','063-467-6601','<Br>\n대한민국 NO.1 토스트 브랜드 <BR>\n주문 즉시 갓 구워내는 토스트를<BR>\n군산대학교에서 만나보세요.<br>\n','resources/img/restaurant/15.png',0,0,'10:30','18:30',1,0,'포만감 임시휴업',3,'햄류 돼지고기: 국내산<br>\n햄류 닭고기: 국내산<br>\n베이컨류 돼지고기: 외국산<br>\n스테이크 햄 쇠고기: 호주산<br>\n불갈비패티 쇠고기: 뉴질랜드산 호주산을 섞음<br>',NULL,0,1,1,0),(16,2,'국수나무','전라북도 군산시 수송동 827-15','063-462-0080','<br>\n저온숙성 방식으로 정성껏 만든 생면과<br>\nHACCP 인증 엄선된 100% 국내산 돈까스<br><br>\n자연으로부터, 농부로부터 얻은 건강한 식재료를 통해 요리합니다.<br>','resources/img/restaurant/16.png',0,0,'10:30','18:30',1,0,'포만감 임시휴업',6,'돈까스,짬뽕류,제육솥덮밥 : 국내산<br>\n고기국수(돼지고기) : 미국산<br>\n소고기쌀국수(소고기) : 호주산<br>\n치킨까스,치킨안심튀김(닭) : 국내산<br>\n치킨카레덮밥(닭) : 브라질산, 국내산 섞음<br>\n오징어 : 칠레산<br>\n콩,쌀 : 국내산<br>\n김치만두, 배추김치 (배추) : 국내산<br>\n김치만두, 배추김치 (고춧가루) : 중국산<br>\n',NULL,0,1,1,0),(17,2,'후성식당',' ',' ','<br>군산 대표 맛집 후성식당','resources/img/restaurant/17.png',0,0,'10:30','18:30',1,0,'포만감 임시휴업',5,'',NULL,0,1,1,0),(22,2,'맥도날드','군산시 나운동 나운로 132','070-7204-4996','<br>버거, 감자튀김, 셰이크로 유명한 오랜 전통의 클래식 패스트푸드 체인점입니다.','resources/img/restaurant/22.png',0,0,'10:30','18:30',1,0,'포만감 임시휴업',1,'쇠고기 : 호주산<br>\n닭고기 : 국내산<br>\n돼지고기 : 미국산<br>\n베이컨 : 외국산(독일,오스트리아,덴마크)<br>\n새우 : 태국산<br>\n100%비프 패티 : 호주산<br>\n돼지고기(캐네디언 스타일 베이컨) : 미국산<br>',NULL,0,1,1,0),(23,2,'장인족발','전북 군산시 나운동 316-23','063-463-7789','<br>장인족발 군산본점',NULL,NULL,NULL,'10:30','18:30',0,0,'제휴준비중',7,'돼지고기, 쌀, 김치, 무 : 국내산',NULL,0,1,1,0),(24,3,'꿀닭','-','064-854-9944','<br>저렴한 가격으로 제공하는 푸짐한 양. <br> 꿀닭 호원대 점','resources/img/restaurant/24.png',0,0,'10:30','20:30',1,0,'포만감 임시휴업',0,'-',NULL,0,1,1,0),(25,3,'피자마루','-','063-843-1082','<br>고오급피자 배터지게 먹어보자 <br>배터짐주의<br> 피자마루 호원대 점','resources/img/restaurant/25.png',0,0,'10:30','20:30',1,0,'포만감 임시휴업',1,'-',NULL,0,1,1,0),(26,3,'엽기떡볶이','-','063-854-8591','<br>\r 한번 먹고 두 번 먹어도 질리지 않는<br>\r 엽기떡볶이만의 매력을 느껴보세요~<br>\r 눈물나게 맵지만 결코 잊을수 없는 맛의 엽기떡볶이.<br>\r 상상 그 이상으로 맵지만 자꾸만 먹고 싶어지는<br>\r 중독성 강한 일품떡볶이!<br><br>\r <b>요청사항에 원하시는 매운맛 정도를 적어주세요.<br>\r ▷ <u>매운맛</u> / <u>오리지널(기본선택)</u> / <u>덜 매운맛</u> / <u>착한맛</u> ◁\r </b><br>','resources/img/restaurant/3.png',0,0,'10:30','20:30',1,0,'포만감 임시휴업',2,'-',NULL,0,1,1,0),(27,3,'고려 왕 족발','-','063-855-8033','<br> 고려 왕 족발 & 보쌈 호원대 점','resources/img/restaurant/27.png',0,0,'10:30','20:30',1,0,'포만감 임시휴업',3,'-',NULL,0,1,1,0),(28,4,'한솥 도시락','-','번호 미설정','<br>\n한솥은 \'따끈한 도시락으로 지역사회에 공헌한다\' 라는<